content:
.product {
  display: flex;
  /* Align the child elements to the top of the parent */
  align-items: flex-start;
  width: 90%;
  margin: 1% auto;
}

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

html {
  height: 100%;
}

body {
  min-height: 100%;
  line-height: 1;
  font-family: sans-serif;
}

h1, h2, h3, h4, h5, h6 {
  font-size: 100%;
}

input, select, option, optgroup, textarea, button,
pre, code {
  font-size: 100%;
  font-family: inherit;
}

ol, ul {
  list-style: none;
}

// `for .. of` loop to iterate over each song and log it to terminal using the `outputCyanText()` method
for (const song of songs) {
  outputCyanText(song);
}

// turn on connection to db and server
sequelize.sync({ force: false }).then(() => {
  app.listen(PORT, () => console.log('Now listening'));
});
